import axios from 'axios'
import './Article.css';

class Article extends Component{

    state = {
        articles: [],
        article_title: '',
        article_body: ''
    };



    render(){
        return(
            <div>
                This is the Article Page
            </div>
        );
    };
};

export default Article;
